import React from 'react';
import './App.css';
import Order from './Order';

class App extends React.Component {
  render() {
    const orders = [{
      id: 102,
      user: "cena@gmail.com",
      product: "Razer Headphone",
      price: {
        value: 99.99,
        currency: "dollars"
      }
    },
    {
      id: 77,
      user: "cena@gmail.com",
      product: "Monster 500mL",
      price: {
        value: 9.99,
        currency: "dollars"
      }
    }];

    return (
      <div className="App">
        <h1> Orders recently created </h1>
         {orders.map((order) => <Order user={order.user} product={order.product} />)}
      </div>
    );
  }
}

export default App;
